import React from "react";
import "../index.css";
import Square from "./square";

export default class FallenSoldierBlock extends React.Component {
    renderSquare(square, i) {
        console.log(square)
        square.style.borderColor = { value: "transparent", writable: true };
        let style = square.style;
        square.defineProperties(style, {
            borderColor: {
                value: "transparent",
                writable: true
            }
        })
        console.log(square)
        return <Square
            piece={square}
            style={square.style}
        />
    }

    render() {
        return (
            <div>
                <div className="board-row">
                    {this.props.whiteFallenSoldiers.map((ws, index) => this.renderSquare(ws, index))}
                </div>
                <div className="board-row">
                    {this.props.blackFallenSoldiers.map((bs, index) => this.renderSquare(bs, index))}
                </div>
            </div>
        );
    }
}
